import React, { Component } from 'react';

const fetchSignup = async (username, password) =>{
  const reqOptions = {
      method: 'POST',
      headers:  { 'Content-Type': 'application/json' },
      body : JSON.stringify({username, password})
  };
  try {
      let res = await fetch('http://localhost:8766/user/signup', reqOptions)
      let resJson = await res.json()
      return resJson;
  } catch (e){
      if (e){
          console.log(e)
      }
  }
}
export default class SignUp extends Component {
  constructor(props){
    super(props)
    this.state={
      username: undefined,
      password: undefined,
    }
    this.handleChangeUsername = this.handleChangeUsername.bind(this)
    this.handleChangePassword = this.handleChangePassword.bind(this)
  }
  handleChangeUsername(value){
    this.setState({
      username: value,
    })
  }
  handleChangePassword(value){
    this.setState({
      password: value,
    })
  }
  render() {
    return (
    <form className="form-signin">
            <h2 className="form-signin-heading"> Please sign in </h2>
            <label for="username" className="sr-only"> Username
            </label>
            <input id="username" className="form-control" required autofocus />
            <label for="inputPassword" className="sr-only"> Password</label>
            <input type="password" id="inputPassword" className="form-control" placeholder="Password" required />
            <button className="btn btn-lg btn-primary btn-block" type="button"> Sign in
            </button>
        </form>
    )
}
}
